import React, {Component} from "react"

export default class Header extends Component{
    render(){
        return(
            <Header>
                <header>
                    <nav class="navbar navbar-light bg-light">
                        <a class="navbar-brand" href="#">Default</a>
                    </nav>
                </header>
            </Header>
        )
    }
}
